const AnalyticsPage = () => {
  return (
    <div className="text-white p-4">
      <h1 className="text-2xl mb-2">Bug Analytics</h1>
      <p>Visual stats like open vs resolved bugs can go here.</p>
    </div>
  );
};

export default AnalyticsPage;
